function Cart(props) {
	const cartItems = (
		<ul className={styles["cart-items"]}>
			{[{ id: "c1", name: "Sushi", amount: "2", price: "11.99" }].map(
				(item) => {
					<li>
						<div>{item.name}</div>
						{/* <div>${item.price}</div> */}
						{/* <div>{item.amount}</div> */}
					</li>;
				}
			)}
		</ul>
	);
	console.log(cartItems);
	return (
		<div>
			{cartItems} <span>Total Amount</span>
			<span>$44.00</span>
			<div className={styles.actions}>
				<button>Close</button>
				<button>Order</button>
			</div>
		</div>
	);
}

export default Cart;
